import React from 'react';
import { Modal, Button, Form } from 'react-bootstrap';
import '../styles/RegistrationModal.css';

const RegistrationModal = ({ show, handleClose }) => {
  const navigate = useNavigate();
  
  const closeModal = () => {
    navigate('/login');
  };

  return (
    <Modal show={show} onHide={handleClose} dialogClassName="custom-modal-width">
      <Modal.Header closeButton onClick={closeModal}>
        <Modal.Title>Get Started With ReAlign!</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <Form>
          <Form.Group controlId="formFirstName">
            <Form.Label>First Name</Form.Label>
            <Form.Control type="text" placeholder="Enter first name" />
          </Form.Group>
          <Form.Group controlId="formLastName">
            <Form.Label>Last Name</Form.Label>
            <Form.Control type="text" placeholder="Enter last name" />
          </Form.Group>
          <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
              <Form.Label>Email address</Form.Label>
              <Form.Control
                type="email"
                placeholder="name@example.com"
                autoFocus
              />
          </Form.Group>
          <Form.Group controlId="formPassword">
            <Form.Label>Password</Form.Label>
            <Form.Control type="password" placeholder="Password" />
          </Form.Group>
          <Form.Group controlId="formRepeatPassword">
            <Form.Label>Repeat Password</Form.Label>
            <Form.Control type="password" placeholder="Repeat Password" />
          </Form.Group>
          {/* <Form.Group>
            <Form.Label>Upload Profile</Form.Label>
            <Form.File id="formProfilePic" />
          </Form.Group> */}
          <Button variant="primary" type="submit" className="mt-3">
            Get Started
          </Button>
        </Form>
      </Modal.Body>
    </Modal>
  );
};

export default RegistrationModal;
